INSERT INTO `taskjob_20170520211046` VALUES ('../content.jsp?id=2c9f814e5c15ede9015c1adbc6870359&classid=a988a9213c254c96b72dbd0568955a30', '围绕“健康中国健康家庭”核心主题，倡导健康生活方式理念，普及健康技能，推广健康行为，提高家庭成员的健康管理能力，促进家庭全面发展开展了系列宣传活动。', '点击57次 2017-05-19', '1592', 'ff27f880-3d7f-11e7-9617-e09467f6dff0', '2017-05-21 01:16:00', '0', null);
INSERT INTO `taskjob_20170520211046` VALUES ('../content.jsp?id=2c9f814e5c15ede9015c1ada6f060357&classid=a988a9213c254c96b72dbd0568955a30', '菜园坝街道通过采取多项措施加强了H7N9禽流感疫情防控工作', '点击58次 2017-05-19', '1592', 'ff2f7291-3d7f-11e7-a5b5-e09467f6dff0', '2017-05-21 01:16:00', '0', null);
INSERT INTO `taskjob_20170520211046` VALUES ('../content.jsp?id=2c9f814e5c15ede9015c1ad96dbe0355&classid=a988a9213c254c96b72dbd0568955a30', '在竹园小区广场开展了防范和打击非法集资宣传活动', '点击53次 2017-05-19', '1592', 'ff36eca1-3d7f-11e7-a6ef-e09467f6dff0', '2017-05-21 01:16:01', '0', null);
INSERT INTO `taskjob_20170520211046` VALUES ('../content.jsp?id=2c9f814e5c15ede9015c1ad7b3660345&classid=a988a9213c254c96b72dbd0568955a30', '由渝中区总工会主办，菜园坝街道总工会、渝中区果品行业协会以及菜园坝水果市场联合承办的“建功十三五，聚力新渝中”菜园坝地区第五届“果香四溢”趣味劳动技能竞赛活动在菜园坝水果市场隆重举行。', '点击52次 2017-05-19', '1592', 'ff3e3f9e-3d7f-11e7-8f2b-e09467f6dff0', '2017-05-21 01:16:01', '0', null);
